const BuildPage = (index) => (
  <div>
    <h3>Page {index}</h3>
    <div>
      Page {index} content: { loremIpsum({ count: 50 })}
    </div>
  </div>
);

const Pasko = (message) => {
    message = 'Плохо'
    return (
    <div>
        <h1>{message} </h1>
        <div>
        <img src={require('ilusha.jpg').default} alt='mops'/>
        </div>
    </div>
    )
}


export const PageOne = () => BuildPage(1);
export const PageTwo = () => BuildPage(2);
